Welcome, traveler, to the Enigma Monument.  

No expectations.  No pressure.  Just sit back and contemplate civilization’s mysteries.Founded November 2019 and featuring:
* Active swap threads;
* A 1.9 thread and arc-building assistance;
* GE (not required, but open to L4 each week);
* GBG (not required, but competitive in the Diamond League).


November 2020 - level 36 and 8 members strong

November 2021 - level 47 and 45 members strong 

November 2022 - level 59 and 72 members strong.
